const Navbar = () => {
    return (
    <nav className="mb-20 flex items-center justify-between py-6 bg-red-700">
      <div className="ml-7 flex flex-shrink-0 items-center">
         <img src="./Logo1.png" alt="" />
      </div>
      <div className="m-8 flex items-center justify-center gap-4 text-2xl ">
        <a href="#">Hello</a>
        <a href="#">How</a>
        <a href="#">Hii</a>
      </div>
    </nav>
    );
  }
  
  export default Navbar;
